pub enum ContractError {
    Std(StdError),
    Unauthorized {
        },
    Claimed {
        },
    Expired {
        },
    InvalidArgument {
            reason: String,
        },
    TokenNotFound {
        },
}

pub enum HandleMsg {
    TransferNft {
            recipient: HumanAddr,
            token_id: String,
        },
    Burn {
            token_id: String,
        },
    ChangeMinter {
            minter: HumanAddr,
        },
    SendNft {
            contract: HumanAddr,
            token_id: String,
            msg: Option<Binary>,
        },
    UpdateNft {
            token_id: String,
            name: String,
            description: Option<String>,
            image: Option<String>,
        },
    Approve {
            spender: HumanAddr,
            token_id: String,
            expires: Option<Expiration>,
        },
    Revoke {
            spender: HumanAddr,
            token_id: String,
        },
    ApproveAll {
            operator: HumanAddr,
            expires: Option<Expiration>,
        },
    RevokeAll {
            operator: HumanAddr,
        },
    Mint(MintMsg),
}

pub enum QueryMsg {
    OwnerOf {
            token_id: String,
            include_expired: Option<bool>,
        },
    ApprovedForAll {
            owner: HumanAddr,
            include_expired: Option<bool>,
            start_after: Option<HumanAddr>,
            limit: Option<u32>,
        },
    NumTokens {
        },
    ContractInfo {
        },
    NftInfo {
            token_id: String,
        },
    AllNftInfo {
            token_id: String,
            include_expired: Option<bool>,
        },
    Tokens {
            owner: HumanAddr,
            start_after: Option<String>,
            limit: Option<u32>,
        },
    AllTokens {
            start_after: Option<String>,
            limit: Option<u32>,
        },
    Minter {
        },
}
